              "videoId": "vgLOv36an3s",
              "textDisplay": "@Jh5578 From all of the hot air you just typed I can really see that you have a misaligned understanding of who GOD is and what He stands for. He is not a genie that magically pops up and grants you your every wish or desire. HE is a Holy God who responds to those who are also made righteous and holy through his son Jesus Christ. All of the stuff you&#39;re mentioning is caused by disfunction and sin in men. Its allowed to exist because men willfully chose to turn away from God and chose to rely on themselves. This all started with Adam disobeying the rules and commands he was given by God. The world that God intially envisioned was made perfect in every way   but free will and self gratification introduced this fallen world in which we live in today. \u003cbr\u003e\u003cbr\u003e\u003cbr\u003eFirst and foremost instead of blaming God for what you see as peril, DO YOU save starving children? There are many here in this country let alone abroad that need help. WHAT ARE YOU DOING ABOUT THIS TODAY?How are you improving the people lives in which you have direct influence ? Jesus told the disciples &quot;The poor will always be with you always.&quot; This means this poverty is inevitable. Therefore to make a change this is a job that people are required to do. Use your own efforts to help combat this.\u003cbr\u003e\u003cbr\u003eCan God create something so heavy he cant lift it ? Hmm.. God can do all things. however, often times God works through people. Which is why instead of you waiting for something to fall out of the sky, pray and ask God for wisdom and guidance and do something about it yourself . God helps those who help themselves. \u003cbr\u003e\u003cbr\u003eAnd yes we do have free will ,which is exactly why the world is in shambles now. God may know what the end result may be ,but it is of your own will and volition that ultimately shape and create your life. If we didn&#39;t have free will, the world would still be consider perfect because Adam would&#39;ve been prevented from doing as he wanted. Free will is gift but can also be a curse if used wrongly. Just because God knows the choices your going to make, it doesnt make you any less responsible for the choice that was made. You have to accept your responsibility in the action. Nobody is predestined for hell. People put themselves in hell by the action and choices they make here on earth. It&#39;s not Gods will for any to perish. \u003cbr\u003e\u003cbr\u003eDisease has plagued mankind since the beginning of time. Yes,people were sick even in the days of Jesus. This is another condition of the fallen world in which we live. This isnt even anything Jesus was proud of which is why he healed numerous people who were plagued with infirmities. This same healing power still exist today.\u003cbr\u003e\u003cbr\u003eTo the children that die due to unfortunate circumstances such as cancer and aids, Its tragic. But understand this: God makes no mistakes. Even if YOU can&#39;t see what the reason for it occurring was ,it doesnt mean there wasn&#39;t one. There are many people who have been lead to God through the death of a loved one.( not saying this is the answer for all but some ) Regardless of why certain things happen is a mysterybut what does hold true is :\u003cbr\u003e&quot;For my thoughts are not your thoughts, neither are your ways my ways,&quot; declares the LORD Isaiah 55:8\u003cbr\u003e\u003cbr\u003eWith that being said some things as difficult as they may be are simply above our level of understanding. Yet, I will trust in everything that happens because I know that it all works together for my good. \u003cbr\u003e\u003cbr\u003e\u003cbr\u003eSatan was and is still controlled by God. meaning God does have rule over all Spirit realms. But oftentimes the actions of Satan and his demons to harm you are caused by what you allow to yourself to be open to. If you&#39;re willfully engaging in sin, expect to be paid a full days wage for that. Sin separates man from God it&#39;s that simple.God is Holy. And should be treated as such. And no.. God doesnt allow Satan to do everything. Satan has to get permission from God in most cases. You should read the book of Job for understanding of how this works because obviously you&#39;re lacking understanding of how spiritual warfare is waged. \u003cbr\u003e\u003cbr\u003eGod supports slavery? You&#39;re reaching now. Just because the bible says obey your masters doesn&#39;t mean its &quot;supports&quot; slavery. Slavery was an unfortunate way of life back then just as it is now. With many Christians being in Slavery at that time whether in debt Slavery, or indentured servitude, obeying your master was a reference referring to obeying those who have rule over you. This is the same way you current6 obey the IRS, THE POLICE, THE GOVT etc. As a matter of fact the same way the bible says obey your masters, it also tells &quot;the masters&quot; to supply your slaves with what is right and fair, since you know that you also have a Master in heaven.&quot; Col 4:1., so it doesnt condone the unfair treatment of anyone. Everyoneis subject to God. Would an oppressor put something in their to inflict themselves? I think not .There are many other passages in the bible as well that support freedom and not Slavery. However because the bible is a spiritual history book, slavery and its acient system was documented.\u003cbr\u003e\u003cbr\u003eAgain,I dont think you have ever read the Bible , or for that matter studied the topics in which you take offense in. \u003cbr\u003e\u003cbr\u003eDemeaning women ? My Bible says men are to love their wife like Christ loves the church. That&#39;s sacrificial agape love . Where is the demeaning in that? Ephesians \u003ca href=\"https://www.youtube.com/watch?v=vgLOv36an3s&amp;t=5m25s\"\u003e5:25\u003c/a\u003e\u003cbr\u003e\u003cbr\u003eExecute gays? Yeah that was in the OLD TESTAMENT Leviticus \u003ca href=\"https://www.youtube.com/watch?v=vgLOv36an3s&amp;t=20m13s\"\u003e20:13\u003c/a\u003e . That is no longer a part of the NEW TESTAMENT but is still considered an abominable sin. That just shows how offensive that lifestyle is to God. Everything in life come from some type of procreation process. God is the giver of this life. When two people engage in homosexual acts it&#39;s not contributing the giving of life , and actually works against it. Its unnatural to nature and the cycle of life. Not to mention the uncleanlininess that comes along with it and more. But even in all of that lunacy and lust , even if they gave their life to God, they also can be forgiven. Nobody is beyond the reach of God. \u003cbr\u003e\u003cbr\u003e\u003cbr\u003eIn regards to you being in sin ,You&#39;re in sin because you have not been born again and have not been reconciled to God. Just like back in the day how animals were used as a sacrafice for atonement of sins, Jesus Christ was the ultimate sacrifice who was the temple and the Lamb. He was the only perfect man(son of God) who lived a righteous life who could take on the sins of mankind. Men and their sinful lifestyles prior to his death, burial ,and resurrection were offensive to God and were subject to Gods Judgment (oftentimes death). Jesus death was was ultimate sacrafice using his blood to atone for the sins of mankind.\u003cbr\u003eHim dying was so that we can live. That&#39;s just how much he loves YOU. So when you choose to reject God and live in sin,this is highly flagrant and opens you up to judgement. \u003cbr\u003e\u003cbr\u003eJesus said I am THE WAY, THE TRUTH, AND THE LIFE. Therefore anything or anybody outside of that will be judged accordingly. There is no other way . This applies to Buddhists, Hindus , Sikhs or whomever.\u003cbr\u003e\u003cbr\u003eThe Bible is so much more than a book. Standard books dont save lives, dont found countries, are not spiritual , and certainly cant save your soul. The bible is the living word and is a spiritual guide. Its not God himself,but its purpose is to show you the mind of God , and have you decide to develop your own relationship with him. This is hard for you to understand because you&#39;re not in a spiritual mindset to receive this . But maybe someday you will be . So of course it&#39;s just an old book to you. \u003cbr\u003e\u003cbr\u003e\u003cbr\u003eJesus Miracles are happening every day and everywhere. I&#39;ve seen, and still see God move in my personal life when I know there was no other way. Not to mention all the times I&#39;ve couldve died,went to jail , gotten sick etc. He delivered me from it all.. Not to mention the many people I&#39;ve seen healed of their sicknesses,  confirmed prophecy, demons cast out ,and so much more. The miracles in the book you read of  Jesus  are of historical value. But people in this day and age are still experiencing the Power of Jesus Christ. Nothings changed. \u003cbr\u003e\u003cbr\u003eBe the change you expect others to be . I thought that was a universal truth. Maybe I shouldve said Treat others as you want to be treated. That&#39;s bible. Either way the truth is still relevant. \u003cbr\u003e\u003cbr\u003eIf you watched the video because Kanye used to be dope and you were a fan then you would still be on board regardless of his changes. You and your wicked outburst was due to the conviction that was raised within yourself . You seen just how large the group of Jesus freaks were in the comment section and spazzed out. It&#39;s ok ,that&#39;s what people with demons do. People with unclean spirits in Jesus Day used to see Jesus from afar and lash out just because of his light. You were no different. \u003cbr\u003e\u003cbr\u003ePeople who comment on things they dont like have critical thinking skills? I would accept that but there was no real substance in any of the post you provided.\u003cbr\u003eWhere was the analytical skill set needed to perform a critical thinking analyses , along with creativity, open mindedness, and problem solving? You just got on here with some atheist nonsense that you picked up somewhere along the way. You werent attempting to be productive in any capacity. You were just blaming God for everything. Maybe that&#39;s your problem always blaming others. Get to know God for yourself . KANYE and his Conversion is good, But the Love of God found in Jesus Christ is even greater. Happy Trolling.\u003cbr\u003e\u003cbr\u003eUnclean Spirit+Jesus Christ= Cast Out. 🌬",
              "textOriginal": "@Jh5578 From all of the hot air you just typed I can really see that you have a misaligned understanding of who GOD is and what He stands for. He is not a genie that magically pops up and grants you your every wish or desire. HE is a Holy God who responds to those who are also made righteous and holy through his son Jesus Christ. All of the stuff you're mentioning is caused by disfunction and sin in men. Its allowed to exist because men willfully chose to turn away from God and chose to rely on themselves. This all started with Adam disobeying the rules and commands he was given by God. The world that God intially envisioned was made perfect in every way   but free will and self gratification introduced this fallen world in which we live in today. \n\n\nFirst and foremost instead of blaming God for what you see as peril, DO YOU save starving children? There are many here in this country let alone abroad that need help. WHAT ARE YOU DOING ABOUT THIS TODAY?How are you improving the people lives in which you have direct influence ? Jesus told the disciples \"The poor will always be with you always.\" This means this poverty is inevitable. Therefore to make a change this is a job that people are required to do. Use your own efforts to help combat this.\n\nCan God create something so heavy he cant lift it ? Hmm.. God can do all things. however, often times God works through people. Which is why instead of you waiting for something to fall out of the sky, pray and ask God for wisdom and guidance and do something about it yourself . God helps those who help themselves. \n\nAnd yes we do have free will ,which is exactly why the world is in shambles now. God may know what the end result may be ,but it is of your own will and volition that ultimately shape and create your life. If we didn't have free will, the world would still be consider perfect because Adam would've been prevented from doing as he wanted. Free will is gift but can also be a curse if used wrongly. Just because God knows the choices your going to make, it doesnt make you any less responsible for the choice that was made. You have to accept your responsibility in the action. Nobody is predestined for hell. People put themselves in hell by the action and choices they make here on earth. It's not Gods will for any to perish. \n\nDisease has plagued mankind since the beginning of time. Yes,people were sick even in the days of Jesus. This is another condition of the fallen world in which we live. This isnt even anything Jesus was proud of which is why he healed numerous people who were plagued with infirmities. This same healing power still exist today.\n\nTo the children that die due to unfortunate circumstances such as cancer and aids, Its tragic. But understand this: God makes no mistakes. Even if YOU can't see what the reason for it occurring was ,it doesnt mean there wasn't one. There are many people who have been lead to God through the death of a loved one.( not saying this is the answer for all but some ) Regardless of why certain things happen is a mysterybut what does hold true is :\n\"For my thoughts are not your thoughts, neither are your ways my ways,\" declares the LORD Isaiah 55:8\n\nWith that being said some things as difficult as they may be are simply above our level of understanding. Yet, I will trust in everything that happens because I know that it all works together for my good. \n\n\nSatan was and is still controlled by God. meaning God does have rule over all Spirit realms. But oftentimes the actions of Satan and his demons to harm you are caused by what you allow to yourself to be open to. If you're willfully engaging in sin, expect to be paid a full days wage for that. Sin separates man from God it's that simple.God is Holy. And should be treated as such. And no.. God doesnt allow Satan to do everything. Satan has to get permission from God in most cases. You should read the book of Job for understanding of how this works because obviously you're lacking understanding of how spiritual warfare is waged. \n\nGod supports slavery? You're reaching now. Just because the bible says obey your masters doesn't mean its \"supports\" slavery. Slavery was an unfortunate way of life back then just as it is now. With many Christians being in Slavery at that time whether in debt Slavery, or indentured servitude, obeying your master was a reference referring to obeying those who have rule over you. This is the same way you current6 obey the IRS, THE POLICE, THE GOVT etc. As a matter of fact the same way the bible says obey your masters, it also tells \"the masters\" to supply your slaves with what is right and fair, since you know that you also have a Master in heaven.\" Col 4:1., so it doesnt condone the unfair treatment of anyone. Everyoneis subject to God. Would an oppressor put something in their to inflict themselves? I think not .There are many other passages in the bible as well that support freedom and not Slavery. However because the bible is a spiritual history book, slavery and its acient system was documented.\n\nAgain,I dont think you have ever read the Bible , or for that matter studied the topics in which you take offense in. \n\nDemeaning women ? My Bible says men are to love their wife like Christ loves the church. That's sacrificial agape love . Where is the demeaning in that? Ephesians 5:25\n\nExecute gays? Yeah that was in the OLD TESTAMENT Leviticus 20:13 . That is no longer a part of the NEW TESTAMENT but is still considered an abominable sin. That just shows how offensive that lifestyle is to God. Everything in life come from some type of procreation process. God is the giver of this life. When two people engage in homosexual acts it's not contributing the giving of life , and actually works against it. Its unnatural to nature and the cycle of life. Not to mention the uncleanlininess that comes along with it and more. But even in all of that lunacy and lust , even if they gave their life to God, they also can be forgiven. Nobody is beyond the reach of God. \n\n\nIn regards to you being in sin ,You're in sin because you have not been born again and have not been reconciled to God. Just like back in the day how animals were used as a sacrafice for atonement of sins, Jesus Christ was the ultimate sacrifice who was the temple and the Lamb. He was the only perfect man(son of God) who lived a righteous life who could take on the sins of mankind. Men and their sinful lifestyles prior to his death, burial ,and resurrection were offensive to God and were subject to Gods Judgment (oftentimes death). Jesus death was was ultimate sacrafice using his blood to atone for the sins of mankind.\nHim dying was so that we can live. That's just how much he loves YOU. So when you choose to reject God and live in sin,this is highly flagrant and opens you up to judgement. \n\nJesus said I am THE WAY, THE TRUTH, AND THE LIFE. Therefore anything or anybody outside of that will be judged accordingly. There is no other way . This applies to Buddhists, Hindus , Sikhs or whomever.\n\nThe Bible is so much more than a book. Standard books dont save lives, dont found countries, are not spiritual , and certainly cant save your soul. The bible is the living word and is a spiritual guide. Its not God himself,but its purpose is to show you the mind of God , and have you decide to develop your own relationship with him. This is hard for you to understand because you're not in a spiritual mindset to receive this . But maybe someday you will be . So of course it's just an old book to you. \n\n\nJesus Miracles are happening every day and everywhere. I've seen, and still see God move in my personal life when I know there was no other way. Not to mention all the times I've couldve died,went to jail , gotten sick etc. He delivered me from it all.. Not to mention the many people I've seen healed of their sicknesses,  confirmed prophecy, demons cast out ,and so much more. The miracles in the book you read of  Jesus  are of historical value. But people in this day and age are still experiencing the Power of Jesus Christ. Nothings changed. \n\nBe the change you expect others to be . I thought that was a universal truth. Maybe I shouldve said Treat others as you want to be treated. That's bible. Either way the truth is still relevant. \n\nIf you watched the video because Kanye used to be dope and you were a fan then you would still be on board regardless of his changes. You and your wicked outburst was due to the conviction that was raised within yourself . You seen just how large the group of Jesus freaks were in the comment section and spazzed out. It's ok ,that's what people with demons do. People with unclean spirits in Jesus Day used to see Jesus from afar and lash out just because of his light. You were no different. \n\nPeople who comment on things they dont like have critical thinking skills? I would accept that but there was no real substance in any of the post you provided.\nWhere was the analytical skill set needed to perform a critical thinking analyses , along with creativity, open mindedness, and problem solving? You just got on here with some atheist nonsense that you picked up somewhere along the way. You werent attempting to be productive in any capacity. You were just blaming God for everything. Maybe that's your problem always blaming others. Get to know God for yourself . KANYE and his Conversion is good, But the Love of God found in Jesus Christ is even greater. Happy Trolling.\n\nUnclean Spirit+Jesus Christ= Cast Out. 🌬",
