              "videoId": "2wShZYdftAA",
              "textDisplay": "@Tyler Lewis Many experts think the wheel probably wasn&#39;t invented until we&#39;d successfully domesticated dray animals already, probably for thousands of years. How eager would \u003cb\u003eyou\u003c/b\u003e be to invent a cart if you have to pull the damn thing? AFAIK, we&#39;d long been using animals to pull carts when someone brilliantly realized how cheap human labour was when you didn&#39;t have to pay the workers and invented the wheelbarrow, and not very long ago, 3 or 4k years ago IIRC. It&#39;s a different story when you can make an ox do the work, or a horse, or a donkey, or even a big dog, especially if you don&#39;t have slaves/serfs. Lots of human societies had no use for the wheel (and didn&#39;t have them as such as a result), and they all lacked creatures suited to drawing a cart (due to the lack of available dray animals in those regions). The wheel isn&#39;t universal by any means!\u003cbr\u003e\u003cbr\u003eThat said, most cultures didn&#39;t have doors period afaik, hanging cloth/strings weren&#39;t unusual I gatherbut that&#39;s not a door. A house in many places might have one door in it, the front one, so you can lock it. Doors are very common nowbut that&#39;s probably because they are super-cheap to make at this point.",
              "textOriginal": "@Tyler Lewis Many experts think the wheel probably wasn't invented until we'd successfully domesticated dray animals already, probably for thousands of years. How eager would *you* be to invent a cart if you have to pull the damn thing? AFAIK, we'd long been using animals to pull carts when someone brilliantly realized how cheap human labour was when you didn't have to pay the workers and invented the wheelbarrow, and not very long ago, 3 or 4k years ago IIRC. It's a different story when you can make an ox do the work, or a horse, or a donkey, or even a big dog, especially if you don't have slaves/serfs. Lots of human societies had no use for the wheel (and didn't have them as such as a result), and they all lacked creatures suited to drawing a cart (due to the lack of available dray animals in those regions). The wheel isn't universal by any means!\n\nThat said, most cultures didn't have doors period afaik, hanging cloth/strings weren't unusual I gatherbut that's not a door. A house in many places might have one door in it, the front one, so you can lock it. Doors are very common nowbut that's probably because they are super-cheap to make at this point.",
