              "videoId": "Pc-lxq3btcI",
              "textDisplay": "@Cole Hatfield We don&#39;t need MORE militant groups, regardless of whether or not they&#39;re on &quot;our side.&quot;\u003cbr\u003eAnd while I agree that Trump is insane and would love to be a dictator, comparing him to Hitler is ridiculous. He&#39;s not even close to that much of a threat. Hitler, although an awful human with repugnant ideologies, was an intelligent, educated guy that surrounded himself with capable advisors and was a very talented orator. Traits that Trump does not possess, and even if he did, we&#39;ve come a long way since the second world war, and there are multiple checks that would prevent him from taking more power. True, he defies norms and traditions and tries to get around checks and balances as much as he canbut there are limits that even his brazen arrogance cannot surmount.\u003cbr\u003eNot to say that he shouldn&#39;t be removed from office ASAP or that people shouldn&#39;t be vigilant. They shouldbut my biggest concern isn&#39;t Trump or his family. It&#39;s this side of the right, the nationalists, white supremacists, the hatred and hostility that are becoming more and more commonplace. The disparaging of the media, the spreading of false information - these things post much greater threats to democracy than Trump does and we need to figure out how to deal with them sooner rather than later, because while Trump will more than likely be removed from office (either by losing reelection, impeachment, resignation or whatever) before he can cause real, lasting harm to democracy, the ideologies he has spread/brought to light and made acceptable could linger on for far longer and continue to erode that which protects us right now, leaving us vulnerable when someone even worse comes along.",
