              "textDisplay": "@HascleAvrahm BenYoseph I read your whole comment.\u003cbr\u003eI&#39;m sure you have good intentions in your heart, so I don&#39;t want to sound like I&#39;m attacking you as a person, rather your ideology. Your comment sounds almost exactly like Marxismbut with &#39;healing the planet&#39; as it&#39;s justification and mission objective, rather than the &#39;freeing of the enslaved proletariat&#39;.\u003cbr\u003eI honestly hate to imagine the poverty we&#39;d be living in if your ideals came to power. In fact, a look at the USSR, communist China, and N Korea are the closet systems to what you just described, and are also the most antihuman, abhorrent forms of society, where human life is worthless.\u003cbr\u003eI truly hope you don&#39;t get your communist wish. \u003cbr\u003eBut I wish you personally all the best.",
              "textOriginal": "@HascleAvrahm BenYoseph I read your whole comment.\nI'm sure you have good intentions in your heart, so I don't want to sound like I'm attacking you as a person, rather your ideology. Your comment sounds almost exactly like Marxismbut with 'healing the planet' as it's justification and mission objective, rather than the 'freeing of the enslaved proletariat'.\nI honestly hate to imagine the poverty we'd be living in if your ideals came to power. In fact, a look at the USSR, communist China, and N Korea are the closet systems to what you just described, and are also the most antihuman, abhorrent forms of society, where human life is worthless.\nI truly hope you don't get your communist wish. \nBut I wish you personally all the best.",
              "parentId": "Ugzg3y6vvRp_nONhtmV4AaABAg",
