          {
            "kind": "youtube#comment",
            "etag": "LFuUGwTuh8ha781VECzrtfO_P8E",
            "id": "Ugzg3y6vvRp_nONhtmV4AaABAg.9Ne4F2rprtx9dfTEIpk9YQ",
            "snippet": {
              "channelId": "UCCj956IF62FbT7Gouszaj9w",
              "videoId": "o4Cw2ASwSnU",
              "textDisplay": "@Brett DW Music That very short note I wrote, which you responded to, has given you the wrong impression.  My idea is that we need a new Global Economic Model GEM.\u003cbr\u003eI&#39;m very deeply concerned about climate change and the single most alarming fact is that almost nobody is addressing how to correct the actual problem, that being our\r\u003cbr\u003eGlobal Economic Model GEM.  Man-made climate change is not the primary problem, because &#39;overshoot&#39; is the direct cause of man-made climate change; additionally,\u003cbr\u003e&#39;overshoot&#39; is not the primary problem, because overshoot is being caused by a very sick Global Economic Model GEM. Our present GEM is not working in harmony with the\u003cbr\u003eenvironment because it is based on an erroneous definition of &#39;profit&#39;.  Within the confines of the present GEM all efforts to correct man-made climate change will at best\u003cbr\u003efail or at worst, will be the last nail in our collective coffin.  Technological changes are sorely neededbut the primary problem is our misbehavior towards the environment.\u003cbr\u003eThat misbehavior is described by the following equation: &quot;Profit = income - expenses&quot;.  The problem with &quot;Profit = income - expenses&quot; is that the entire environment is on the\u003cbr\u003eexpense art of the equation, and that includes us.  Businesses want to eliminate expenses; thus, &quot;Profit = income - expenses&quot; is a recipe for the destruction of the environment and\u003cbr\u003eall life on earth. Our current definition of profit is the cause of &#39;overshoot&#39;, and overshoot is the cause of man-made climate change.\u003cbr\u003e\u003cbr\u003eWe need a new Global Economic Model GEM that supports a new definition of profit. How about this definition:\r\u003cbr\u003e\r\u003cbr\u003e&quot;Profit = our gratefulness and loving care for our Environment, and for the sustenance that it provides to all of us.&quot;  Clearly, this definition of profit does require a new GEM.\r\u003cbr\u003e\r\u003cbr\u003ePlease bear in mind that this definition of profit does away with expenses.  In nature&#39;s economy we have already been paid in full, in advance.  Our job in nature is\r\u003cbr\u003eto acquire sustenance without going into Overshoot. (note: Overshoot is when we take more from the environment than nature can replace.) \r\u003cbr\u003e\r\u003cbr\u003eThe central part of the new Global Economic Model should be the EPA.  EPA members will vote on the best &#39;Profit&#39; definition that states sustenance is\r\u003cbr\u003eour only actual &#39;gain&#39; without which we can&#39;t live, and states that the environment is our only source of sustenance.  Once the new GEM is designed, we will need a way\r\u003cbr\u003eto transition to its implementation.\r\u003cbr\u003e\r\u003cbr\u003eAs the central hub of the new GEM, EPA members will establish, by vote, all directives related to both, the GEM and climate rescue strategies.\u003cbr\u003e\u003cbr\u003eHere are just some rough ideas of what the EPA directives might be.  Keep in mind that these directives can work under the new GEM\r\u003cbr\u003ebut they would not work under the current Global Economic Model.\u003cbr\u003e1.)  Population: Initially we need a temporary one child per family directive.\r\u003cbr\u003e2.)  In place of income, jobs would have an &#39;equivalency rating&#39;.  Some jobs are still more important and more difficult than others.\r\u003cbr\u003e3.)  All equivalency ratings will increase at the same time if and when the environment becomes healthier. The lowest EquivRate must still be livable.\r\u003cbr\u003e4.)  Everyone who can work will be able, and required, to get jobs.  No more expenses, so no more cutting jobs to reduce expenses; thus, virtually no more homelessness.\r\u003cbr\u003e5.)  No manufacturing of useless and unnecessary products.  All products will be scrutinized by various rating methods.\r\u003cbr\u003e6.)  Whenever possible products should last a lifetime and or be easily upgradable, so we don&#39;t buy the same products repeatedly.\r\u003cbr\u003e7.)  EPA will direct &quot;Work Force Flow&quot;.  Example:  Shoe manufacturer will produce 100yearLife shoes for 3 years, then reduce output to about 1/10 of full capacity, and\r\u003cbr\u003e     the majority of shoe employees will be shifted to other work assignments by the EPA.  Employees still keep their EquivRate in-between jobs.\r\u003cbr\u003e8.)  All recyclable items will be recycled. All stores like wal-Mart Target etc. will carry both recycled and new products. Recycled costs far fewer EquivRate credits.\r\u003cbr\u003e     Items that can&#39;t be recycled as is will be reprocessed for other purposes. Virtually nothing gets thrown away.\r\u003cbr\u003e9.)  We must all be educated, especially young students, about how to manage the new Global Economic Model and the environment.\r\u003cbr\u003e10.) Caretakers of the environment will receive higher than average  EquivRates.\r\u003cbr\u003e11.)  We must do away with neoliberalism, a political approach that favors free-market capitalism, deregulation, and reduction in government spending.\r\u003cbr\u003e\r\u003cbr\u003eI know that this is just a rough outline of what we must dobut it&#39;s a good starting point.\r\u003cbr\u003e\r\u003cbr\u003eThis is our Ark.  Please help build it!  Questions, suggestions and any comments for or against this idea will be very deeply appreciated. Thank you!\u003cbr\u003e💖",
              "textOriginal": "@Brett DW Music That very short note I wrote, which you responded to, has given you the wrong impression.  My idea is that we need a new Global Economic Model GEM.\nI'm very deeply concerned about climate change and the single most alarming fact is that almost nobody is addressing how to correct the actual problem, that being our\r\nGlobal Economic Model GEM.  Man-made climate change is not the primary problem, because 'overshoot' is the direct cause of man-made climate change; additionally,\n'overshoot' is not the primary problem, because overshoot is being caused by a very sick Global Economic Model GEM. Our present GEM is not working in harmony with the\nenvironment because it is based on an erroneous definition of 'profit'.  Within the confines of the present GEM all efforts to correct man-made climate change will at best\nfail or at worst, will be the last nail in our collective coffin.  Technological changes are sorely neededbut the primary problem is our misbehavior towards the environment.\nThat misbehavior is described by the following equation: \"Profit = income - expenses\".  The problem with \"Profit = income - expenses\" is that the entire environment is on the\nexpense art of the equation, and that includes us.  Businesses want to eliminate expenses; thus, \"Profit = income - expenses\" is a recipe for the destruction of the environment and\nall life on earth. Our current definition of profit is the cause of 'overshoot', and overshoot is the cause of man-made climate change.\n\nWe need a new Global Economic Model GEM that supports a new definition of profit. How about this definition:\r\n\r\n\"Profit = our gratefulness and loving care for our Environment, and for the sustenance that it provides to all of us.\"  Clearly, this definition of profit does require a new GEM.\r\n\r\nPlease bear in mind that this definition of profit does away with expenses.  In nature's economy we have already been paid in full, in advance.  Our job in nature is\r\nto acquire sustenance without going into Overshoot. (note: Overshoot is when we take more from the environment than nature can replace.) \r\n\r\nThe central part of the new Global Economic Model should be the EPA.  EPA members will vote on the best 'Profit' definition that states sustenance is\r\nour only actual 'gain' without which we can't live, and states that the environment is our only source of sustenance.  Once the new GEM is designed, we will need a way\r\nto transition to its implementation.\r\n\r\nAs the central hub of the new GEM, EPA members will establish, by vote, all directives related to both, the GEM and climate rescue strategies.\n\nHere are just some rough ideas of what the EPA directives might be.  Keep in mind that these directives can work under the new GEM\r\nbut they would not work under the current Global Economic Model.\n1.)  Population: Initially we need a temporary one child per family directive.\r\n2.)  In place of income, jobs would have an 'equivalency rating'.  Some jobs are still more important and more difficult than others.\r\n3.)  All equivalency ratings will increase at the same time if and when the environment becomes healthier. The lowest EquivRate must still be livable.\r\n4.)  Everyone who can work will be able, and required, to get jobs.  No more expenses, so no more cutting jobs to reduce expenses; thus, virtually no more homelessness.\r\n5.)  No manufacturing of useless and unnecessary products.  All products will be scrutinized by various rating methods.\r\n6.)  Whenever possible products should last a lifetime and or be easily upgradable, so we don't buy the same products repeatedly.\r\n7.)  EPA will direct \"Work Force Flow\".  Example:  Shoe manufacturer will produce 100yearLife shoes for 3 years, then reduce output to about 1/10 of full capacity, and\r\n     the majority of shoe employees will be shifted to other work assignments by the EPA.  Employees still keep their EquivRate in-between jobs.\r\n8.)  All recyclable items will be recycled. All stores like wal-Mart Target etc. will carry both recycled and new products. Recycled costs far fewer EquivRate credits.\r\n     Items that can't be recycled as is will be reprocessed for other purposes. Virtually nothing gets thrown away.\r\n9.)  We must all be educated, especially young students, about how to manage the new Global Economic Model and the environment.\r\n10.) Caretakers of the environment will receive higher than average  EquivRates.\r\n11.)  We must do away with neoliberalism, a political approach that favors free-market capitalism, deregulation, and reduction in government spending.\r\n\r\nI know that this is just a rough outline of what we must dobut it's a good starting point.\r\n\r\nThis is our Ark.  Please help build it!  Questions, suggestions and any comments for or against this idea will be very deeply appreciated. Thank you!\n💖",
